import React, { Component } from "react";
import { Route, NavLink, HashRouter, Redirect } from "react-router-dom";
import Home from "./Home";
import Video from "./Video";
import Account from "./Account";
import SideNav, {
  Toggle,
  Nav,
  NavItem,
  NavIcon,
  NavText
} from "@trendmicro/react-sidenav";

// Be sure to include styles at some point, probably during your bootstraping
import "@trendmicro/react-sidenav/dist/react-sidenav.css";

class Main extends Component {
  render() {
    return (
      <HashRouter>
        <div id="wrapper">
          <SideNav
            onSelect={selected => {
              if(selected == "home"){
                window.location.replace("/")
              }
              else if(selected == "watch"){
                window.location.replace("/watch")
              }
              else if(selected == "account"){
                window.location.replace("/account")
              }
            }}
          >
            <SideNav.Toggle />
            <SideNav.Nav defaultSelected="home">
              <NavItem eventKey="home">
                <NavIcon>
                  <i
                    className="fa fa-fw fa-home"
                    style={{ fontSize: "1.75em" }}
                  />
                </NavIcon>
                <NavText>Home</NavText>
              </NavItem>
              <NavItem eventKey="watch">
                <NavIcon>
                  <i
                    className="fas fa-film"
                    style={{ fontSize: "1.75em" }}
                  />
                </NavIcon>
                <NavText>Videos</NavText>
              </NavItem>
              <NavItem eventKey="account">
                <NavIcon>
                  <i
                    className="fas fa-user"
                    style={{ fontSize: "1.75em" }}
                  />
                </NavIcon>
                <NavText>Account</NavText>
              </NavItem>
            </SideNav.Nav>
          </SideNav>
          <main className="content">
            <Route id="home" exact path="/" component={Home} />
            <Route id="watch" path="/watch" component={Video} />
            <Route id="account" path="/account" component={Account} />
          </main>
        </div>
      </HashRouter>
    );
  }
}

export default Main;
